import React, {Component} from 'react';
import Particles from 'react-particles-js';

import SiteHeader from "./SiteHeader";
import SiteFooter from "./SiteFooter";
import Landing from "./Landing";

class App extends Component {
    constructor(props) {
        super(props);

    }

    render() {
        return(
              <div>
                <SiteHeader />
                <Particles
                  params={{
                      polygon: {
                          enable: true,
                          type: 'inside',
                          move: {
                              radius: 10
                          },
                          url: './media/dna.svg'
                      }
                  }} />
                <Landing />
                <SiteFooter />
              </div>
          );
    }
}

export default App;
